import React, { Component } from 'react'
import { Cascader } from 'antd';



export default class CitySwitcher extends React.Component {


    render() {
        const options = [
            {
                value: 'zhejiang',
                label: 'Zhejiang',
                children: [
                    {
                        value: 'hangzhou',
                        label: 'Hangzhou',
                    },
                ],
            },
            {
                value: 'jiangsu',
                label: 'Jiangsu',
                children: [
                    {
                        value: 'nanjing',
                        label: 'Nanjing',
                    },
                ],
            },
        ];
        function onChange(value) {
            console.log(value);
        }

        // Just show the latest item.
        // function displayRender(label) {
        //     return label[label.length - 1];
        // }
        return (
            <Cascader
                options={options}
                expandTrigger="hover"
                onChange={onChange}
            />
        );
    }
}
